var title_f39_61_40922="Transplant glomerulopathy Light";
var content_f39_61_40922=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F58239%7ENEPH%2F79914&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F58239%7ENEPH%2F79914&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Transplant glomerulopathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 243px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph of transplant glomerulopathy shows a membranoproliferative pattern with capillary wall thickening and a double-contour appearance due to mesangial interposition (arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 253px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph of a normal glomerulus. There are only 1 or 2 cells per capillary tuft, the capillary lumens are open, the thickness of the glomerular capillary wall (long arrow) is similar to that of the tubular basement membranes (short arrow), and the mesangial cells and mesangial matrix are located in the central or stalk regions of the tuft (arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut G Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Transplant glomerulopathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 243px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph of transplant glomerulopathy reveals marked narrowing of the vascular lumen due to widening of the subenthothelial space both by mesangial cell processes (arrow) and by amorphous, electron-lucent material.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Electron micrograph of a normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 266px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph of a normal glomerular capillary loop showing the fenestrated endothelial cell (Endo), the glomerular basement membrane (GBM), and the epithelial cells with its interdigitating foot processes (arrow). The GBM is thin, and no electron dense deposits are present. Two normal platelets are seen in the capillary lumen.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
