" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pes planus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 394px; height: 287px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Examination for pes planus (flat feet) should be part of the evaluation of any patient with a rheumatologic complaint in the lower extremity. This condition is usually best viewed from the posterior. Eversion of the heels is also evident in this position.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from Sheon, RP, Moskowitz, RW, Goldberg, VM. Soft Tissue Rheumatic Pain: Recognition, Management, Prevention, 3rd ed, Williams &amp; Wilkins, Baltimore 1996.",
"    </div>",
"   </div>",
